import React, { Component } from 'react';

class CourseList extends Component {

    render() { 
        console.log(this.props.courses);
        return(
            <ul>
             {this.props.courses.map(course=>{
                <li>{course.name}</li>
             })
             }
            </ul>
        )
    }
}

export default CourseList;
